.
Claypot cooking allows the rich flavours of the ingredients to be retained, while keeping the dish at the optimal warmness for consumption. At A-One Claypot House, you can be assured that your meal is fresh, flavourful and steaming hot! 🥄
.
Some of our favourite Porridge includes their Signature Dried Scallop Porridge with Minced Meat, Century Egg, Salted Egg and Egg, and the Dried Scallop Porridge with Century Egg, Minced Meat and Cuttlefish 🥚
.
The Bundle for 2 Dishes Promotion is going for $26.90! For that price, you get a choice of 1 Vegetable Dish and 2 Main Dish, which you get to choose from a selection of Rice, Noodles and Porridge. On top of that, you also get 2 Beverages 🍜
.
